import React from "react";

export default function TestRedux() {
  return (
    <div className="card">
      <img
        className="card-img-top"
        src="https://picsum.photos/200/300"
        alt="hinhAnh"
      />
      <div className="card-body">
        <h4 className="card-title">Title</h4>
        <p className="card-text">Text</p>
      </div>
    </div>
  );
}
